        10 -> d_field_Job_type(Rest, 0, 0, 0, F@_1, F@_2, TrUserData);
        18 -> d_field_Job_metadata(Rest, 0, 0, 0, F@_1, F@_2, TrUserData);
        _ ->
            case Key band 7 of
                0 -> skip_varint_Job(Rest, 0, 0, Key bsr 3, F@_1, F@_2, TrUserData);
                1 -> skip_64_Job(Rest, 0, 0, Key bsr 3, F@_1, F@_2, TrUserData);
