read_group(Bin, FieldNum) ->
    {NumBytes, EndTagLen} = read_gr_b(Bin, 0, 0, 0, 0, FieldNum),
    <<Group:NumBytes/binary, _:EndTagLen/binary, Rest/binary>> = Bin,
    {Group, Rest}.

%% Like skipping over fields, but record the total length,
%% Each field is <(FieldNum bsl 3) bor FieldType> ++ <FieldValue>
%% Record the length because varints may be non-optimally encoded.
%%
%% Groups can be nested, but assume the same FieldNum cannot be nested
%% because group field numbers are shared with the rest of the fields
%% numbers. Thus we can search just for an group-end with the same
%% field number.
%%
%% (The only time the same group field number could occur would
%% be in a nested sub message, but then it would be inside a
%% length-delimited entry, which we skip-read by length.)
read_gr_b(<<1:1, X:7, Tl/binary>>, N, Acc, NumBytes, TagLen, FieldNum)
  when N < (32-7) ->
    read_gr_b(Tl, N+7, X bsl N + Acc, NumBytes, TagLen+1, FieldNum);
read_gr_b(<<0:1, X:7, Tl/binary>>, N, Acc, NumBytes, TagLen,
          FieldNum) ->
    Key = X bsl N + Acc,
    TagLen1 = TagLen + 1,
    case {Key bsr 3, Key band 7} of
        {FieldNum, 4} -> % 4 = group_end
            {NumBytes, TagLen1};
        {_, 0} -> % 0 = varint
            read_gr_vi(Tl, 0, NumBytes + TagLen1, FieldNum);
        {_, 1} -> % 1 = bits64
            <<_:64, Tl2/binary>> = Tl,
            read_gr_b(Tl2, 0, 0, NumBytes + TagLen1 + 8, 0, FieldNum);
        {_, 2} -> % 2 = length_delimited
            read_gr_ld(Tl, 0, 0, NumBytes + TagLen1, FieldNum);
        {_, 3} -> % 3 = group_start
            read_gr_b(Tl, 0, 0, NumBytes + TagLen1, 0, FieldNum);
        {_, 4} -> % 4 = group_end
            read_gr_b(Tl, 0, 0, NumBytes + TagLen1, 0, FieldNum);
        {_, 5} -> % 5 = bits32
            <<_:32, Tl2/binary>> = Tl,
            read_gr_b(Tl2, 0, 0, NumBytes + TagLen1 + 4, 0, FieldNum)
    end.

read_gr_vi(<<1:1, _:7, Tl/binary>>, N, NumBytes, FieldNum)
  when N < (64-7) ->
    read_gr_vi(Tl, N+7, NumBytes+1, FieldNum);
read_gr_vi(<<0:1, _:7, Tl/binary>>, _, NumBytes, FieldNum) ->
    read_gr_b(Tl, 0, 0, NumBytes+1, 0, FieldNum).

read_gr_ld(<<1:1, X:7, Tl/binary>>, N, Acc, NumBytes, FieldNum)
  when N < (64-7) ->
    read_gr_ld(Tl, N+7, X bsl N + Acc, NumBytes+1, FieldNum);
read_gr_ld(<<0:1, X:7, Tl/binary>>, N, Acc, NumBytes, FieldNum) ->
    Len = X bsl N + Acc,
    NumBytes1 = NumBytes + 1,
    <<_:Len/binary, Tl2/binary>> = Tl,
    read_gr_b(Tl2, 0, 0, NumBytes1 + Len, 0, FieldNum).

merge_msgs(Prev, New) when element(1, Prev) =:= element(1, New) -> merge_msgs(Prev, New, element(1, Prev), []).

merge_msgs(Prev, New, MsgName) when is_atom(MsgName) -> merge_msgs(Prev, New, MsgName, []);
merge_msgs(Prev, New, Opts) when element(1, Prev) =:= element(1, New), is_list(Opts) -> merge_msgs(Prev, New, element(1, Prev), Opts).

merge_msgs(Prev, New, MsgName, Opts) ->
    TrUserData = proplists:get_value(user_data, Opts),
    case MsgName of
        'ExecResult' -> merge_msg_ExecResult(Prev, New, TrUserData);
        'Job' -> merge_msg_Job(Prev, New, TrUserData)
    end.

-compile({nowarn_unused_function,merge_msg_ExecResult/3}).
merge_msg_ExecResult(#'ExecResult'{assignment_id = PFassignment_id, request_id = PFrequest_id, status = PFstatus, provider_id = PFprovider_id, job = PFjob, latency_ms = PFlatency_ms, cost = PFcost, trace_id = PFtrace_id, tenant_id = PFtenant_id,
                                   timestamp = PFtimestamp, error_code = PFerror_code, error_message = PFerror_message},
                     #'ExecResult'{assignment_id = NFassignment_id, request_id = NFrequest_id, status = NFstatus, provider_id = NFprovider_id, job = NFjob, latency_ms = NFlatency_ms, cost = NFcost, trace_id = NFtrace_id, tenant_id = NFtenant_id, timestamp = NFtimestamp,
                                   error_code = NFerror_code, error_message = NFerror_message},
                     TrUserData) ->
    #'ExecResult'{assignment_id =
                      if NFassignment_id =:= undefined -> PFassignment_id;
                         true -> NFassignment_id
                      end,
                  request_id =
                      if NFrequest_id =:= undefined -> PFrequest_id;
                         true -> NFrequest_id
                      end,
                  status =
                      if NFstatus =:= undefined -> PFstatus;
                         true -> NFstatus
                      end,
                  provider_id =
                      if NFprovider_id =:= undefined -> PFprovider_id;
                         true -> NFprovider_id
                      end,
                  job =
                      if PFjob /= undefined, NFjob /= undefined -> merge_msg_Job(PFjob, NFjob, TrUserData);
                         PFjob == undefined -> NFjob;
                         NFjob == undefined -> PFjob
                      end,
                  latency_ms =
                      if NFlatency_ms =:= undefined -> PFlatency_ms;
                         true -> NFlatency_ms
                      end,
                  cost =
                      if NFcost =:= undefined -> PFcost;
                         true -> NFcost
                      end,
                  trace_id =
                      if NFtrace_id =:= undefined -> PFtrace_id;
                         true -> NFtrace_id
                      end,
                  tenant_id =
                      if NFtenant_id =:= undefined -> PFtenant_id;
                         true -> NFtenant_id
                      end,
                  timestamp =
                      if NFtimestamp =:= undefined -> PFtimestamp;
                         true -> NFtimestamp
                      end,
                  error_code =
                      if NFerror_code =:= undefined -> PFerror_code;
                         true -> NFerror_code
                      end,
                  error_message =
                      if NFerror_message =:= undefined -> PFerror_message;
                         true -> NFerror_message
                      end}.

-compile({nowarn_unused_function,merge_msg_Job/3}).
merge_msg_Job(#'Job'{type = PFtype, metadata = PFmetadata}, #'Job'{type = NFtype, metadata = NFmetadata}, TrUserData) ->
    #'Job'{type =
               if NFtype =:= undefined -> PFtype;
                  true -> NFtype
               end,
           metadata =
               if PFmetadata /= undefined, NFmetadata /= undefined -> 'tr_merge_Job.metadata'(PFmetadata, NFmetadata, TrUserData);
                  PFmetadata == undefined -> NFmetadata;
                  NFmetadata == undefined -> PFmetadata
               end}.


verify_msg(Msg) when tuple_size(Msg) >= 1 -> verify_msg(Msg, element(1, Msg), []);
verify_msg(X) -> mk_type_error(not_a_known_message, X, []).

verify_msg(Msg, MsgName) when is_atom(MsgName) -> verify_msg(Msg, MsgName, []);
verify_msg(Msg, Opts) when tuple_size(Msg) >= 1 -> verify_msg(Msg, element(1, Msg), Opts);
verify_msg(X, _Opts) -> mk_type_error(not_a_known_message, X, []).

verify_msg(Msg, MsgName, Opts) ->
    TrUserData = proplists:get_value(user_data, Opts),
    case MsgName of
        'ExecResult' -> v_msg_ExecResult(Msg, [MsgName], TrUserData);
        'Job' -> v_msg_Job(Msg, [MsgName], TrUserData);
        _ -> mk_type_error(not_a_known_message, Msg, [])
    end.


-compile({nowarn_unused_function,v_msg_ExecResult/3}).
-dialyzer({nowarn_function,v_msg_ExecResult/3}).
v_msg_ExecResult(#'ExecResult'{assignment_id = F1, request_id = F2, status = F3, provider_id = F4, job = F5, latency_ms = F6, cost = F7, trace_id = F8, tenant_id = F9, timestamp = F10, error_code = F11, error_message = F12}, Path, TrUserData) ->
    if F1 == undefined -> ok;
       true -> v_type_string(F1, [assignment_id | Path], TrUserData)
    end,
    if F2 == undefined -> ok;
       true -> v_type_string(F2, [request_id | Path], TrUserData)
    end,
    if F3 == undefined -> ok;
       true -> v_type_string(F3, [status | Path], TrUserData)
    end,
    if F4 == undefined -> ok;
       true -> v_type_string(F4, [provider_id | Path], TrUserData)
    end,
    if F5 == undefined -> ok;
       true -> v_submsg_Job(F5, [job | Path], TrUserData)
    end,
    if F6 == undefined -> ok;
       true -> v_type_int64(F6, [latency_ms | Path], TrUserData)
    end,
    if F7 == undefined -> ok;
       true -> v_type_double(F7, [cost | Path], TrUserData)
    end,
    if F8 == undefined -> ok;
       true -> v_type_string(F8, [trace_id | Path], TrUserData)
    end,
    if F9 == undefined -> ok;
       true -> v_type_string(F9, [tenant_id | Path], TrUserData)
    end,
    if F10 == undefined -> ok;
       true -> v_type_int64(F10, [timestamp | Path], TrUserData)
    end,
    if F11 == undefined -> ok;
       true -> v_type_string(F11, [error_code | Path], TrUserData)
    end,
    if F12 == undefined -> ok;
       true -> v_type_string(F12, [error_message | Path], TrUserData)
    end,
    ok;
v_msg_ExecResult(X, Path, _TrUserData) -> mk_type_error({expected_msg, 'ExecResult'}, X, Path).

-compile({nowarn_unused_function,v_submsg_Job/3}).
-dialyzer({nowarn_function,v_submsg_Job/3}).
v_submsg_Job(Msg, Path, TrUserData) -> v_msg_Job(Msg, Path, TrUserData).

-compile({nowarn_unused_function,v_msg_Job/3}).
-dialyzer({nowarn_function,v_msg_Job/3}).
v_msg_Job(#'Job'{type = F1, metadata = F2}, Path, TrUserData) ->
    if F1 == undefined -> ok;
       true -> v_type_string(F1, [type | Path], TrUserData)
    end,
    'v_map<string,string>'(F2, [metadata | Path], TrUserData),
    ok;
v_msg_Job(X, Path, _TrUserData) -> mk_type_error({expected_msg, 'Job'}, X, Path).

-compile({nowarn_unused_function,v_type_int64/3}).
-dialyzer({nowarn_function,v_type_int64/3}).
v_type_int64(N, _Path, _TrUserData) when is_integer(N), -9223372036854775808 =< N, N =< 9223372036854775807 -> ok;
v_type_int64(N, Path, _TrUserData) when is_integer(N) -> mk_type_error({value_out_of_range, int64, signed, 64}, N, Path);
v_type_int64(X, Path, _TrUserData) -> mk_type_error({bad_integer, int64, signed, 64}, X, Path).

-compile({nowarn_unused_function,v_type_double/3}).
-dialyzer({nowarn_function,v_type_double/3}).
v_type_double(N, _Path, _TrUserData) when is_float(N) -> ok;
v_type_double(N, _Path, _TrUserData) when is_integer(N) -> ok;
v_type_double(infinity, _Path, _TrUserData) -> ok;
v_type_double('-infinity', _Path, _TrUserData) -> ok;
v_type_double(nan, _Path, _TrUserData) -> ok;
v_type_double(X, Path, _TrUserData) -> mk_type_error(bad_double_value, X, Path).

-compile({nowarn_unused_function,v_type_string/3}).
-dialyzer({nowarn_function,v_type_string/3}).
v_type_string(S, Path, _TrUserData) when is_list(S); is_binary(S) ->
    try unicode:characters_to_binary(S) of
        B when is_binary(B) -> ok;
        {error, _, _} -> mk_type_error(bad_unicode_string, S, Path)
    catch
        error:badarg -> mk_type_error(bad_unicode_string, S, Path)
    end;
v_type_string(X, Path, _TrUserData) -> mk_type_error(bad_unicode_string, X, Path).

-compile({nowarn_unused_function,'v_map<string,string>'/3}).
-dialyzer({nowarn_function,'v_map<string,string>'/3}).
'v_map<string,string>'(KVs, Path, TrUserData) when is_list(KVs) ->
    [case X of
         {Key, Value} ->
             v_type_string(Key, [key | Path], TrUserData),
             v_type_string(Value, [value | Path], TrUserData);
         _ -> mk_type_error(invalid_key_value_tuple, X, Path)
     end
     || X <- KVs],
    ok;
'v_map<string,string>'(X, Path, _TrUserData) -> mk_type_error(invalid_list_of_key_value_tuples, X, Path).

-compile({nowarn_unused_function,mk_type_error/3}).
-spec mk_type_error(_, _, list()) -> no_return().
mk_type_error(Error, ValueSeen, Path) ->
    Path2 = prettify_path(Path),
    erlang:error({gpb_type_error, {Error, [{value, ValueSeen}, {path, Path2}]}}).


-compile({nowarn_unused_function,prettify_path/1}).
-dialyzer({nowarn_function,prettify_path/1}).
prettify_path([]) -> top_level;
prettify_path(PathR) -> lists:append(lists:join(".", lists:map(fun atom_to_list/1, lists:reverse(PathR)))).


-compile({nowarn_unused_function,id/2}).
-compile({inline,id/2}).
id(X, _TrUserData) -> X.

-compile({nowarn_unused_function,v_ok/3}).
-compile({inline,v_ok/3}).
v_ok(_Value, _Path, _TrUserData) -> ok.

-compile({nowarn_unused_function,m_overwrite/3}).
-compile({inline,m_overwrite/3}).
m_overwrite(_Prev, New, _TrUserData) -> New.

-compile({nowarn_unused_function,cons/3}).
-compile({inline,cons/3}).
cons(Elem, Acc, _TrUserData) -> [Elem | Acc].

-compile({nowarn_unused_function,lists_reverse/2}).
-compile({inline,lists_reverse/2}).
'lists_reverse'(L, _TrUserData) -> lists:reverse(L).
-compile({nowarn_unused_function,'erlang_++'/3}).
-compile({inline,'erlang_++'/3}).
'erlang_++'(A, B, _TrUserData) -> A ++ B.
-compile({inline,'tr_encode_Job.metadata[x]'/2}).
'tr_encode_Job.metadata[x]'(X, _) -> mt_maptuple_to_pseudomsg_r(X, 'map<string,string>').

-compile({inline,'tr_decode_init_default_Job.metadata'/2}).
'tr_decode_init_default_Job.metadata'(_, _) -> mt_empty_map_r().

-compile({inline,'tr_merge_Job.metadata'/3}).
'tr_merge_Job.metadata'(X1, X2, _) -> mt_merge_maptuples_r(X1, X2).

-compile({inline,'tr_decode_repeated_finalize_Job.metadata'/2}).
'tr_decode_repeated_finalize_Job.metadata'(L, _) -> mt_finalize_items_r(L).

-compile({inline,'tr_decode_repeated_add_elem_Job.metadata'/3}).
'tr_decode_repeated_add_elem_Job.metadata'(Elem, L, _) -> mt_add_item_r(Elem, L).

-compile({inline,mt_maptuple_to_pseudomsg_r/2}).
mt_maptuple_to_pseudomsg_r({K, V}, RName) -> {RName, K, V}.


-compile({inline,mt_empty_map_r/0}).
mt_empty_map_r() -> [].

-compile({inline,mt_add_item_r/2}).
mt_add_item_r({_RName, K, V}, Acc) -> [{K, V} | Acc].


-compile({inline,mt_finalize_items_r/1}).
mt_finalize_items_r(Acc) -> mt_finalize_items_r_aux(lists:reverse(Acc), dict:new()).

mt_finalize_items_r_aux([{K, V} | Tl], D) -> mt_finalize_items_r_aux(Tl, dict:store(K, V, D));
mt_finalize_items_r_aux([], D) -> dict:to_list(D).


-compile({inline,mt_merge_maptuples_r/2}).
mt_merge_maptuples_r(L1, L2) -> dict:to_list(dict:merge(fun (_Key, _V1, V2) -> V2 end, dict:from_list(L1), dict:from_list(L2))).




